import{q as e,y as r,x as i,Y as a}from"./chunks/framework.-sYaBLvc.js";const c=JSON.parse('{"title":"Audio Programming","description":"List of most notable audio programming languages","frontmatter":{"title":"Audio Programming","description":"List of most notable audio programming languages","date":"2014-06-02T00:00:00.000Z"},"headers":[],"relativePath":"theory/synthesis/audio-programming/index.md","filePath":"theory/synthesis/audio-programming/index.md","lastUpdated":1724773977000}'),t={name:"theory/synthesis/audio-programming/index.md"},n=a('<ul><li><a href="https://en.wikipedia.org/wiki/ABC_notation" title="ABC notation" target="_blank" rel="noreferrer">ABC notation</a>, a language for notating music using the ASCII character set</li><li><a href="https://bolprocessor.org/" target="_blank" rel="noreferrer">Bol Processor</a>, a model of <a href="https://en.wikipedia.org/wiki/Formal_grammar" title="Formal grammar" target="_blank" rel="noreferrer">formal grammars</a> enriched with polymetric expressions for the representation of time structures</li><li><a href="https://en.wikipedia.org/wiki/ChucK" title="ChucK" target="_blank" rel="noreferrer">ChucK</a>, strongly timed, concurrent, and on-the-fly audio programming language</li><li><a href="https://en.wikipedia.org/wiki/Real-time_Cmix" title="Real-time Cmix" target="_blank" rel="noreferrer">Real-time Cmix</a>, a <a href="https://en.wikipedia.org/wiki/MUSIC-N" title="MUSIC-N" target="_blank" rel="noreferrer">MUSIC-N</a> synthesis language somewhat similar to Csound</li><li><a href="https://cmajor.dev/" target="_blank" rel="noreferrer">Cmajor</a>, a high-performance JIT-compiled C-style language for DSP</li><li><a href="https://en.wikipedia.org/wiki/Common_Lisp_Music" title="Common Lisp Music" target="_blank" rel="noreferrer">Common Lisp Music</a> (CLM), a music synthesis and signal processing package in the Music V family</li><li><a href="https://en.wikipedia.org/wiki/Csound" title="Csound" target="_blank" rel="noreferrer">Csound</a>, a <a href="https://en.wikipedia.org/wiki/MUSIC-N" title="MUSIC-N" target="_blank" rel="noreferrer">MUSIC-N</a> synthesis language released under the <a href="https://en.wikipedia.org/wiki/GNU_Lesser_General_Public_License" title="GNU Lesser General Public License" target="_blank" rel="noreferrer">LGPL</a> with many available <a href="https://en.wikipedia.org/wiki/Unit_generator" title="Unit generator" target="_blank" rel="noreferrer">unit generators</a></li><li><a href="https://elementary.audio" target="_blank" rel="noreferrer">Elementary audio</a>, a JavaScript library for digital audio signal processing. Generate and transform sound, both natively and in the browser with a functional, declarative API.</li><li><a href="https://en.wikipedia.org/wiki/Extempore_(software)" title="Extempore (software)" target="_blank" rel="noreferrer">Extempore</a>, a live-coding environment that borrows a core foundation from the <a href="https://en.wikipedia.org/wiki/Impromptu_(programming_environment)" title="Impromptu (programming environment)" target="_blank" rel="noreferrer">Impromptu</a> environment</li><li><a href="https://en.wikipedia.org/wiki/FAUST_(programming_language)" title="FAUST (programming language)" target="_blank" rel="noreferrer">FAUST</a>, Functional Audio Stream, a functional compiled language for efficient real-time audio signal processing</li><li><a href="https://glicol.org" target="_blank" rel="noreferrer">GLICOL</a>, a graph-oriented live coding language written in Rust</li><li><a href="https://en.wikipedia.org/wiki/Hierarchical_Music_Specification_Language" title="Hierarchical Music Specification Language" target="_blank" rel="noreferrer">Hierarchical Music Specification Language</a> (HMSL), optimized more for music than synthesis, developed in the 1980s in <a href="https://en.wikipedia.org/wiki/Forth_(programming_language)" title="Forth (programming language)" target="_blank" rel="noreferrer">Forth</a></li><li><a href="https://en.wikipedia.org/wiki/Impromptu_(programming_environment)" title="Impromptu (programming environment)" target="_blank" rel="noreferrer">Impromptu</a>, a <a href="https://en.wikipedia.org/wiki/Scheme_(programming_language)" title="Scheme (programming language)" target="_blank" rel="noreferrer">Scheme</a> language environment for <a href="https://en.wikipedia.org/wiki/Mac_OS_X" title="Mac OS X" target="_blank" rel="noreferrer">Mac OS X</a> capable of sound and video synthesis, algorithmic composition, and 2D and 3D graphics programming</li><li><a href="https://en.wikipedia.org/wiki/Ixi_lang" title="Ixi lang" target="_blank" rel="noreferrer">Ixi lang</a>, a programming language for live coding musical expression.</li><li><a href="https://en.wikipedia.org/wiki/JFugue" title="JFugue" target="_blank" rel="noreferrer">JFugue</a>, a Java and JVM library for programming music that outputs to MIDI and has the ability to convert to formats including ABC Notation, Lilypond, and MusicXML</li><li><a href="https://en.wikipedia.org/wiki/JMusic" title="JMusic" target="_blank" rel="noreferrer">jMusic</a></li><li><a href="https://en.wikipedia.org/wiki/JSyn" title="JSyn" target="_blank" rel="noreferrer">JSyn</a></li><li><a href="https://en.wikipedia.org/wiki/Keykit" title="Keykit" target="_blank" rel="noreferrer">Keykit</a>, a programming language and portable graphical environment for MIDI music composition</li><li><a href="https://en.wikipedia.org/wiki/Kyma_(sound_design_language)" title="Kyma (sound design language)" target="_blank" rel="noreferrer">Kyma (sound design language)</a></li><li><a href="https://en.wikipedia.org/wiki/LilyPond" title="LilyPond" target="_blank" rel="noreferrer">LilyPond</a>, a computer program and file format for music engraving.</li><li><a href="https://en.wikipedia.org/wiki/Max/MSP" title="Max/MSP" target="_blank" rel="noreferrer">Max/MSP</a>, a proprietary, modular visual programming language aimed at sound synthesis for music</li><li><a href="https://en.wikipedia.org/wiki/Music_Macro_Language" title="Music Macro Language" target="_blank" rel="noreferrer">Music Macro Language</a> (MML), often used to produce <a href="https://en.wikipedia.org/wiki/Chiptune" title="Chiptune" target="_blank" rel="noreferrer">chiptune</a> music in Japan</li><li><a href="https://en.wikipedia.org/wiki/MUSIC-N" title="MUSIC-N" target="_blank" rel="noreferrer">MUSIC-N</a>, includes versions I, II, III, IV, IV-B, IV-BF, V, 11, and 360</li><li><a href="https://en.wikipedia.org/wiki/Nyquist_(programming_language)" title="Nyquist (programming language)" target="_blank" rel="noreferrer">Nyquist</a></li><li><a href="https://en.wikipedia.org/wiki/OpenMusic" title="OpenMusic" target="_blank" rel="noreferrer">OpenMusic</a></li><li><a href="https://100r.co/site/orca.html" title="Orca (music programming language)" target="_blank" rel="noreferrer">Orca (music programming language)</a>, a two-dimensional esoteric programming language in which every letter of the alphabet is an operator, where lowercase letters operate on bang, uppercase letters operate each frame</li><li><a href="https://en.wikipedia.org/wiki/Pure_Data" title="Pure Data" target="_blank" rel="noreferrer">Pure Data</a>, a modular visual programming language for signal processing aimed at music creation</li><li><a href="https://tidalcycles.org/" title="Tidal Cycles (page does not exist)" target="_blank" rel="noreferrer">Tidal Cycles</a>, a live coding environment for algorithmic patterns, written in Haskell and using Supercollider for synthesis</li><li><a href="https://en.wikipedia.org/wiki/Reaktor" title="Reaktor" target="_blank" rel="noreferrer">Reaktor</a></li><li><a href="https://en.wikipedia.org/wiki/Sonic_Pi" title="Sonic Pi" target="_blank" rel="noreferrer">Sonic Pi</a></li><li><a href="https://en.wikipedia.org/wiki/Structured_Audio_Orchestra_Language" title="Structured Audio Orchestra Language" target="_blank" rel="noreferrer">Structured Audio Orchestra Language</a> (SAOL), part of the <a href="https://en.wikipedia.org/wiki/MPEG-4_Structured_Audio" title="MPEG-4 Structured Audio" target="_blank" rel="noreferrer">MPEG-4 Structured Audio</a> standard</li><li><a href="https://en.wikipedia.org/wiki/SuperCollider" title="SuperCollider" target="_blank" rel="noreferrer">SuperCollider</a></li><li><a href="https://en.wikipedia.org/wiki/SynthEdit" title="SynthEdit" target="_blank" rel="noreferrer">SynthEdit</a>, a modular visual programming language for signal processing aimed at creating <a href="https://en.wikipedia.org/wiki/Audio_plug-in" title="Audio plug-in" target="_blank" rel="noreferrer">audio plug-ins</a></li><li><a href="https://github.com/dy/melo" target="_blank" rel="noreferrer">melo</a> - Micro language for floatbeats and audio, it has smooth operator and organic sugar. Compiles to compact 0-runtime WASM with linear memory.</li><li><a href="https://github.com/Bubobubobubobubo/topos?" target="_blank" rel="noreferrer">topos</a> - A Web-Based Algorithmic Sequencer. Topos is a web based live coding environment designed to be installation-free, independant and fun.</li></ul>',1),o=[n];function l(g,s,p,u,m,d){return i(),r("div",null,o)}const f=e(t,[["render",l]]);export{c as __pageData,f as default};
